import css from './CustomQuantity.module.css';

const CustomQuantity = () => {
  return (
    <>
      <div className={css.customQuantitySection}>
        <div className="customAmountBlock">
          <div className="customAmountTitle">Your Custom Amount</div>
          <input type="number" placeholder="Enter custom quantity" />
        </div>
        <div className="customDiscountBlock">
          <div className="customDiscountTitle">Your Discount</div>
          <div className="customDiscountPercent">0% off</div>
        </div>
      </div>
      <div className="customQuntityText">
        You need <span className="customQuntitySpan">473</span> more likes for{' '}
        <span className="customQuntitySpan">15%</span> discount
      </div>
    </>
  );
};

export default CustomQuantity;
